ndingWithEnterpriseData:"உங்கள் நிறுவனத்தின் தரவு",GroundingWithEnterpriseDataLabel:"உங்கள் நிறுவனத்தின் தரவைப் பயன்படுத்துதல்",GroundingWithEnterpriseDataDescription:"உங்கள் நிறுவனம் முழுவதும் உள்ள நபர்கள் மற்றும் கோப்புகள் தொடர்பான கேள்விகளைக் கேட்கவும்",GroundingWithEnterpriseDataDescriptionV2:"ஒரு அட்டவணையில் உள்ள தரவுடன் பணிபுரிவதற்குத் தொடர்பில்லாத, உங்கள் நிறுவனம் முழுவதும் உள்ள நபர்கள் மற்றும் கோப்புகள் தொடர்பான கேள்விகளைக் கேளுங்கள்.",GroundingSourceInformationTooltip:"பொதுவான கேள்விகளுக்கு பதிலளிப்பதோடு கூடுதலாக, இந்த பணிப்புத்தகம் அல்லது கோப்புகள் மற்றும் மக்களின் தொடர்புத் தகவல் போன்ற நிறுவனத் தரவு தொடர்பான கோரிக்கைகளுக்கு Copilot ஆல் பதிலளிக்க முடியும்.",GroundingSourceInformationTooltipV2:'பொதுவான கேள்விகள் மற்றும் உங்கள் உள்ளடக்கத்தில் வேலை செய்ய, "இந்த பணிப்புத்தகம்" பயன்படுத்தவும். உள்ளடக்கத்தை உருவாக்குவது அல்லது திருத்துவது தொடர்பான உங்கள் நிறுவனம் தொடர்பான கேள்விகளுக்கு, "உங்கள் நிறுவனத்தின் தரவு" என்பதைப் பயன்படுத்தவும்.',GroundingDocToWorkModeSwitchMessage:"உங்களுக்கு பதிலளிக்க உங்கள் நிறுவனத்தின் தரவைப் பயன்படுத்துகிறேன். உங்கள் நிறுவனம் முழுவதிலும் உள்ள நபர்கள் மற்றும் கோப்புகள் தொடர்பான கேள்விகளை என்னிடம் கேளுங்கள். நான் இந்த பயன்முறையில் இருக்கும்போது உங்கள் உள்ளடக்கத்துடன் வேலை செய்ய முடியாது என்பதை நினைவில் கொள்க.",GroundingWorkToDocModeSwitchMessage:"உங்களுக்குப் பதிலளிக்க இந்தப் பணிப்புத்தகத்தையும் பொது அறிவையும் பயன்படுத்துகிறேன். என்னிடம் கேள்விகளைக் கேட்டு, உங்கள் தரவுடன் பணிபுரிவதற்கான கோரிக்கைகளை உருவாக்குங்கள்.",PythonInsertCodeActiveSheetButtonText:"செருகுங்கள்",PythonInsertAllCodeActiveSheetButtonText:"அனைத்தையும் செருகு",PythonInsertCodeNewSheetButtonText:"புதிய தாளில் செருகு",PythonInsertProtectedSheetErrorText:"இது ஒரு கடவுச்சொல் பாதுகாக்கப்பட்ட பணித்தாள் போலத் தெரிகிறது மற்றும் Excel-இல் Python தானாகக் குறியீட்டைப் பணித்தாளில் செருக முடியாது. கடவுச்சொல்லை அகற்றிவிட்டு மீண்டும் முயலவும், ஆனால் நீங்கள் முடித்ததும், இந்தப் பணித்தாளைப் பாதுகாப்பாக வைத்திருக்க, கடவுச்சொல்லை மீண்டும் சேர்ப்பதற்குப் பரிந்துரைக்கிறோம்.",PythonInsert